defmodule Rostrum.Meetings.Event do
  import Ecto.Changeset

  @derive JSON.Encoder
  @derive Jason.Encoder
  defstruct [:id, :type, :term, :number, :name, :verses, :performer, :private_notes]

  @field_types %{
     id: :string,
     type: :string,
     term: :string,
     number: :integer,
     name: :string,
     verses: :string,
     performer: :string,
     private_notes: :string
   }
  @allowed_types [
     "opening-hymn",
     "closing-hymn",
     "sacrament-hymn",
     "rest-hymn",
     "hymn",
     "musical-number",
     "speaker",
     "opening-prayer",
     "closing-prayer",
     "sacrament",
     "baby-blessing",
     "announcements",
     "testimonies",
     "ward-business",
     "stake-business",
     "ward-stake-business",
     "prompt",
     "custom"
   ]

  def changeset(e, attrs) do
    {e, @field_types}
    |> cast(attrs, Map.keys(@field_types))
    |> validate_required([:id, :type])
    |> validate_inclusion(:type, @allowed_types)
  end

  def from_map(attrs) do
    changeset(%__MODULE__{}, attrs)
    |> apply_action(:edit)
  end

  def hymn_name(nil), do: ""

  def hymn_name(""), do: ""

  def hymn_name(number) when not is_integer(number) do
    case Integer.parse(number) do
      :error -> "Invalid"
      {num, _rest} -> hymn_name(num)
    end
  end

